import React from 'react';
import { UISref, UIRouter, UIView, pushStateLocationPlugin, servicesPlugin, UIRouterReact} from "@uirouter/react";

//OnsenUI
var Ons = require('onsenui');
var ROns = require('react-onsenui');

export default class extends React.Component {
    constructor(){
      super();
    }
  
    render(){
      return (
    <ROns.Splitter>
    <ROns.SplitterSide
      width={200}>
      <ListTitle>Меню</ListTitle>
   <List
     dataSource={this.state.data}
     renderHeader={() =>
        <ListHeader style={{fontSize: 15}} className="testClass"> Header Text </ListHeader> }
    renderRow={(row, idx) => (
      <ListItem > {row} </ListItem>
    )}
  />
    </ROns.SplitterSide>

    <ROns.SplitterContent>
      <ROns.Page>
          <UIView />
      </ROns.Page>
    </ROns.SplitterContent>

    </ROns.Splitter>
      );
    }
  }
